import React, { useState, FC } from 'react';
import { useParams, Link } from 'react-router-dom';
import { 
  Building, GraduationCap, Users, Search, 
  Shield, CheckCircle, AlertTriangle, TrendingUp, 
  FileText, Download, Upload, Settings, 
  Bell, LogOut, Plus, Filter, Trash2,
  BarChart3, Calendar, Clock, Award, Eye
} from 'lucide-react';

// Define TypeScript interfaces
interface Institute {
  id: string;
  name: string;
  address: string;
  contact: string;
  date: string;
}

interface Report {
  id: string;
  name: string;
  type: string;
  date: string;
  status: string;
}

interface StatItem {
  label: string;
  value: string;
  change: string;
  icon: FC<{ className?: string }>;
}

interface UserTypeConfig {
  title: string;
  icon: FC<{ className?: string }>;
  color: string;
  iconColor: string;
  tabs: string[];
  stats: StatItem[];
}

const Dashboard: FC = () => {
  const { userType = 'government' } = useParams<{ userType: string }>();
  const [activeTab, setActiveTab] = useState('overview');

  // Rest of the component code remains the same...
  // [Previous component code here]

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header with Tabs */}
      <header className="bg-white shadow">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-4">
          <div className="flex flex-col md:flex-row justify-between items-start md:items-center space-y-4 md:space-y-0">
            <div className="flex items-center">
              <div className={`p-2 rounded-lg ${config.iconColor || 'bg-gray-100'}`}>
                <Icon className={`w-6 h-6 ${config.color?.split(' ')[1] || 'text-gray-600'}`} />
              </div>
              <h1 className="ml-3 text-2xl font-bold text-gray-900">
                {config.title || 'Dashboard'}
              </h1>
            </div>
            <nav className="w-full md:w-auto overflow-x-auto">
              <div className="flex space-x-1">
                {config.tabs.map((tab) => (
                  <button
                    key={tab}
                    onClick={() => setActiveTab(tab)}
                    className={`px-4 py-2 text-sm font-medium whitespace-nowrap border-b-2 ${
                      activeTab === tab
                        ? 'border-blue-500 text-blue-600'
                        : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                    }`}
                  >
                    {tab.split(' ').map(word => word.charAt(0).toUpperCase() + word.slice(1)).join(' ')}
                  </button>
                ))}
              </div>
            </nav>
          </div>
        </div>
      </header>

      {/* Main Content */}
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        {renderTabContent()}
      </div>
    </div>
  );
};

export default Dashboard;
